import { Component, OnInit } from '@angular/core';
import top

@Component({
  selector: 'app-q3-ow2',
  templateUrl: './q3-ow2.component.html',
  styleUrls: ['./q3-ow2.component.css']
})
export class Q3Ow2Component implements OnInit{
  TopPerGames: TopPerGame[] = [];

  constructor(
    private leaderboardService: LeaderboardService,
    private router: Router,
  ) { }

  ngOnInit(): void {
    this.leaderboardService.getTopPerGame(1)
      .subscribe(TopPerGames => this.TopPerGames = TopPerGames);
  }

  makeQuery(gameID: number): void {
    this.leaderboardService.getTopPerGame(gameID)
      .subscribe(() => {
        this.router.navigateByUrl(`/q3`);
      });
  }
}
